import React from "react";
import Logo from "../../assets/images/square-logo.png";
import "./Header.css";

const Header = () => {
  return (
    <div className="Header">

      <div className="logo">
        <img src={Logo} alt="" />
      </div>
      <div className="userInfo">hhs</div>
    </div>
  );
};

export default Header;
